package ManishLokesh.Neptune.v1.GetOrderFromIRCTC.RequestBody;public class DeliveryDetails {    private String trainNo;    private String trainName;    private String station;    private String stationCode;    private String berth;    private String coach;    private String ETA;    private String ETD;    private Long passengerCount;    public String getTrainNo() {        return trainNo;    }    public void setTrainNo(String trainNo) {        this.trainNo = trainNo;    }    public String getTrainName() {        return trainName;    }    public void setTrainName(String trainName) {        this.trainName = trainName;    }    public String getStation() {        return station;    }    public void setStation(String station) {        this.station = station;    }    public String getStationCode() {        return stationCode;    }    public void setStationCode(String stationCode) {        this.stationCode = stationCode;    }    public String getBerth() {        return berth;    }    public void setBerth(String berth) {        this.berth = berth;    }    public String getCoach() {        return coach;    }    public void setCoach(String coach) {        this.coach = coach;    }    public String getETA() {        return ETA;    }    public void setETA(String ETA) {        this.ETA = ETA;    }    public String getETD() {        return ETD;    }    public void setETD(String ETD) {        this.ETD = ETD;    }    public Long getPassengerCount() {        return passengerCount;    }    public void setPassengerCount(Long passengerCount) {        this.passengerCount = passengerCount;    }}